function App() {
  return (
    <div className="App">
      <div>
        <h1>tekkukanji</h1>
        <h2>テックかんじ</h2>
        <h3>a kanji learning system for JAPN at Georgia Tech</h3>
        <div>what class are you taking?</div>
        <div>what lesson would you like to review?</div>
      </div>
    </div>
  );
}

export default App;
